import React, { useState } from 'react';
import './App.css';
import SideBar from './components/sideBar/sideBar.js';
import Dashboard from './components/contentHolder/dashboard.js';
import NotYetImpl from './components/contentHolder/notYetImpl.js';
import Wallet from './components/contentHolder/wallet.js';

import {
  BrowserRouter,
  Routes,
  Route,
  Switch,
} from "react-router-dom";


const App = (props) => {

  const [currentSection,changeCurrentSection] = useState(0);

  return (
  	<BrowserRouter>

   	<div className= {"h-screen grid grid-cols-12 font-nunito"}>

  		<div className={"col-span-4"}>
  			<SideBar currentSection={currentSection} switcher={changeCurrentSection} />
  		</div>

   		<div className={"col-span-8"}>

			  	 	<Routes>
            <Switch>
				        <Route path="/" element={<Dashboard />} />
                <Route path="/Dashboard" element={<Dashboard />} />
				        <Route path="/Wallet" element={<Wallet />} />
                <Route element={<NotYetImpl />} />
                </Switch>
				    </Routes>


   		</div>

	</div>


	 </BrowserRouter>


  );
}


export default App;
